import React from 'react';
import logo from '../assets/logo.png';

const Header = () => {
  return (
    <header className="py-4 bg-white shadow">
      <div className="container mx-auto flex items-center justify-between px-6">
        <a href="/" className="flex items-center space-x-2">
          <img src={logo} alt="Replaice Logo" className="h-8" />
          <span className="text-xl font-bold text-gray-800">Replaice.ai</span>
        </a>
        <nav className="flex items-center space-x-6">
          <a href="#product" className="text-gray-600 hover:text-gray-900">Product</a>
          <a href="#agents" className="text-gray-600 hover:text-gray-900">Agents</a>
          <a href="#resources" className="text-gray-600 hover:text-gray-900">Resources</a>
          <a href="#pricing" className="text-gray-600 hover:text-gray-900">Pricing</a>
          <a href="#login" className="text-gray-600 hover:text-gray-900">Login</a>
          <a href="#signup" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">Sign Up</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
